import React from "react";

export default function Message_content({sender, date, email, subject, content}) {
    return (
        <>
            <div className="message-items">
                <div className="message-sender-date"><p>{sender} <small>{date}</small></p></div>
                <div className="message-email">{email}</div>
                <div className="message-subject">{subject}</div>
                <div className="message-content">{content}</div>
            </div>
        </>
    );
}
